	Color
} from 'three';
import { Pass } from './Pass.js';

/**
 * This class can be used to force a clear operation for the current read or
 * default framebuffer (when rendering to screen).
 *
 * ```js
 * const clearPass = new ClearPass();
 * composer.addPass( clearPass );
 * ```
 *
 * @augments Pass
